package Lec9;
import java.util.*;
public class Array_ip {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc= new Scanner(System.in);
		int n= sc.nextInt();
		int [] arr=new int[n];
		for(int i=0;i<arr.length;i++) {
			arr[i]=sc.nextInt();
			System.out.print(arr[i]+" ");
		}
		
	}

}
